final List<dynamic> styles = ['.app-bar-button {\n  width: 56px;\n  height: 56px;\n  padding: 14px;\n  cursor: pointer;\n  user-select: none;\n  transition: background-color 250ms ease, opacity 150ms ease, transform 250ms ease;\n}\n.app-bar-button.active {\n  background: #152451;\n}\n@media only screen and (min-width: 768px) {\n  .app-bar-button {\n    width: 60px;\n    height: 60px;\n  }\n}\n\n.scrolling-blocked {\n  position: fixed;\n  left: 0;\n  right: 0;\n  z-index: 1;\n  overflow: hidden;\n}\n\n.page-title {\n  display: none;\n}\n@media only screen and (min-width: 768px) {\n  .page-title {\n    display: flex;\n    flex-flow: row;\n    align-items: center;\n    justify-content: space-between;\n    padding-top: 20px;\n  }\n  .page-title h3 {\n    color: #ffffff;\n    font-weight: 600;\n    font-size: 30px;\n    text-transform: uppercase;\n  }\n}\n\n@media only screen and (min-width: 1024px) {\n  .content-wrapper {\n    margin: 0 auto;\n    width: 70%;\n    min-width: 850px;\n    padding: 100px 0;\n  }\n}\nheader {\n  background: #363636;\n  box-shadow: 0 10px 60px rgba(0, 0, 0, 0.4);\n  width: 100%;\n  height: 56px;\n  position: fixed;\n  top: 0;\n  opacity: 1;\n  z-index: 3000;\n  transition: opacity 350ms ease, top 350ms ease;\n}\nheader.hidden {\n  top: -56px;\n  opacity: 0;\n}\n\n.wrapper {\n  display: flex;\n  justify-content: space-between;\n  align-content: center;\n  width: 100%;\n  padding-left: 20px;\n}\n\n.left {\n  display: flex;\n}\n\n.right {\n  display: flex;\n}\n\n.logo {\n  position: relative;\n  display: flex;\n  color: #ffffff;\n  align-items: center;\n  text-decoration: none;\n  user-select: none;\n  cursor: pointer;\n}\n.logo img {\n  width: 42px;\n  height: 42px;\n  margin-top: 2px;\n}\n.logo h1 {\n  display: none;\n  font-size: 20px;\n  font-weight: 500;\n  color: #FEFEFE;\n}\n.logo .mobile-logo-focus-trap {\n  position: absolute;\n  top: 0;\n  left: 0;\n  right: 0;\n  bottom: 0;\n}\n\n.name-and-selected-theater {\n  display: flex;\n  flex